function generate_experiences(e){for(var s=0;s<e.length;s++)if(1==e[s].display){var i=['<div class="resume-item d-flex flex-column flex-md-row justify-content-between mb-5">',' <div class="resume-content">','   <h3 class="mb-0">',"     {{#image}}",'       <img src="img\\Experience Icons\\{{image}}" class="icon_photo"> &nbsp',"     {{/image}}","     {{company}} -  {{location}}","   </h3>",'   <div class="subheading mb-3">{{title}}{{#skills}} ({{skills}}){{/skills}}</div>','   <ul class="fa-ul mb-0" style="list-style-type:disc;">',"     {{#details}}","       <li>{{.}}</li>","     {{/details}}","   </ul>"," </div>",' <div class="resume-date text-md-right">','   <span class="text-primary">{{startDate}}{{#endDate}} - {{endDate}}{{/endDate}}</span>'," </div>","</div>"].join("\n"),n=Mustache.render(i,e[s]);$("#experience-container").append(n)}}fetch("../content/experiences.json").then((e=>e.json())).then((e=>generate_experiences(e.experiences)));